import { Link, Outlet } from "react-router-dom";

const Menu = () => {
    return (
        <div>
            <nav>
                <ul>
                    <li> <Link to='/api' >api</Link> </li>
                    <li> <Link to='/counter' >counter</Link> </li>
                    <li> <Link to='/form' >form</Link> </li>
                </ul>
            </nav>
            <div>
                <Outlet />
            </div> 
        </div>
    );
}

export default Menu;
